module.exports = /*#__PURE__*/JSON.parse('{"termsOfService":{"title":"이용약관","content":[{"subtitle":"제1조 (목적)","text":"이 약관은 EM베스트(이하 \'회사\'라 함)가 제공하는 서비스의 이용조건 및 절차, 회사와 회원 간의 권리, 의무, 책임사항과 기타 필요한 사항을 규정함을 목적으로 합니다."},{"subtitle":"제2조 (용어의 정의)","text":"이 약관에서 사용하는 용어의 정의는 다음과 같습니다.\\n1. \'서비스\'란 회사가 제공하는 마케팅 및 광고 서비스를 의미합니다.\\n2. \'회원\'이란 회사와 서비스 이용계약을 체결하고 회사가 제공하는 서비스를 이용하는 개인 또는 법인을 말합니다."},{"subtitle":"제3조 (약관의 효력 및 변경)","text":"1. 회사는 이 약관의 내용을 회원이 쉽게 알 수 있도록 서비스 초기 화면에 게시합니다.\\n2. 회사는 필요한 경우 관련법령을 위배하지 않는 범위에서 이 약관을 개정할 수 있습니다.\\n3. 회사가 약관을 개정할 경우에는 적용일자 및 개정사유를 명시하여 현행약관과 함께 서비스 초기화면에 그 적용일자 7일 이전부터 적용일자 전일까지 공지합니다."},{"subtitle":"제4조 (서비스의 제공 및 변경)","text":"1. 회사는 다음과 같은 서비스를 제공합니다.\\n   - 마케팅 및 광고 서비스\\n   - 기타 회사가 정하는 서비스\\n2. 회사는 서비스의 내용 및 제공일정을 변경할 수 있으며, 이 경우 변경 내용을 사전에 공지합니다."},{"subtitle":"제5조 (서비스 이용계약의 성립)","text":"1. 서비스 이용계약은 회원이 서비스 이용을 신청하고 회사가 이를 승낙함으로써 성립합니다.\\n2. 회사는 다음 각 호에 해당하는 신청에 대하여는 승낙을 하지 않을 수 있습니다.\\n   - 실명이 아니거나 타인의 명의를 이용한 경우\\n   - 허위의 정보를 기재하거나, 회사가 요구하는 정보를 제공하지 않은 경우\\n   - 관련법령에 위배되거나 사회의 안녕질서 혹은 미풍양속을 저해할 목적으로 신청한 경우"},{"subtitle":"제6조 (회원정보의 변경)","text":"회원은 개인정보관리화면을 통하여 언제든지 본인의 개인정보를 열람하고 수정할 수 있습니다."},{"subtitle":"제7조 (계약해지 및 이용제한)","text":"1. 회원이 이용계약을 해지하고자 하는 때에는 회원 본인이 직접 회사에 해지 신청을 하여야 합니다.\\n2. 회사는 회원이 다음 각 호에 해당하는 행위를 하였을 경우 사전통지 없이 이용계약을 해지하거나 또는 서비스 이용을 제한할 수 있습니다.\\n   - 타인의 서비스 이용을 방해하거나 정보를 도용하는 등 전자상거래질서를 위협하는 경우\\n   - 서비스를 이용하여 법령과 이 약관이 금지하거나 공서양속에 반하는 행위를 하는 경우"},{"subtitle":"제8조 (면책조항)","text":"1. 회사는 천재지변 또는 이에 준하는 불가항력으로 인하여 서비스를 제공할 수 없는 경우에는 서비스 제공에 관한 책임이 면제됩니다.\\n2. 회사는 회원의 귀책사유로 인한 서비스 이용의 장애에 대하여 책임을 지지 않습니다."},{"subtitle":"제9조 (준거법 및 관할법원)","text":"1. 이 약관의 해석 및 회사와 회원간의 분쟁에 대하여는 대한민국 법을 적용합니다.\\n2. 서비스 이용으로 발생한 분쟁에 대해 소송이 제기될 경우 회사의 소재지를 관할하는 법원을 전속관할법원으로 합니다."}]},"privacyPolicy":{"title":"개인정보처리방침","content":[{"subtitle":"1. 개인정보의 수집 및 이용 목적","text":"회사는 다음의 목적을 위하여 개인정보를 처리합니다. 처리하고 있는 개인정보는 다음의 목적 이외의 용도로는 이용되지 않으며, 이용 목적이 변경되는 경우에는 개인정보 보호법 제18조에 따라 별도의 동의를 받는 등 필요한 조치를 이행할 예정입니다.\\n- 서비스 제공 및 계약의 이행\\n- 회원 관리\\n- 마케팅 및 광고에의 활용"},{"subtitle":"2. 수집하는 개인정보의 항목","text":"회사는 서비스 제공을 위해 다음과 같은 개인정보를 수집합니다.\\n- 필수항목: 이름, 이메일 주소, 연락처\\n- 선택항목: 회사명, 직책"},{"subtitle":"3. 개인정보의 보유 및 이용기간","text":"회사는 원칙적으로 개인정보 수집 및 이용목적이 달성된 후에는 해당 정보를 지체 없이 파기합니다. 단, 관계법령의 규정에 의하여 보존할 필요가 있는 경우 회사는 아래와 같이 관계법령에서 정한 일정한 기간 동안 회원정보를 보관합니다.\\n- 계약 또는 청약철회 등에 관한 기록: 5년\\n- 대금결제 및 재화 등의 공급에 관한 기록: 5년\\n- 소비자의 불만 또는 분쟁처리에 관한 기록: 3년"},{"subtitle":"4. 개인정보의 파기절차 및 방법","text":"회사는 개인정보 보유기간의 경과, 처리목적 달성 등 개인정보가 불필요하게 되었을 때에는 지체없이 해당 개인정보를 파기합니다.\\n- 파기절차: 회사는 파기 사유가 발생한 개인정보를 선정하고, 회사의 개인정보 보호책임자의 승인을 받아 개인정보를 파기합니다.\\n- 파기방법: 전자적 파일 형태로 기록․저장된 개인정보는 기록을 재생할 수 없도록 파기하며, 종이 문서에 기록․저장된 개인정보는 분쇄기로 분쇄하거나 소각하여 파기합니다."},{"subtitle":"5. 개인정보의 안전성 확보조치","text":"회사는 개인정보의 안전성 확보를 위해 다음과 같은 조치를 취하고 있습니다.\\n- 관리적 조치: 내부관리계획 수립․시행, 정기적 직원 교육 등\\n- 기술적 조치: 개인정보처리시스템 등의 접근권한 관리, 접근통제시스템 설치, 고유식별정보 등의 암호화, 보안프로그램 설치"},{"subtitle":"6. 개인정보 보호책임자","text":"회사는 개인정보 처리에 관한 업무를 총괄해서 책임지고, 개인정보 처리와 관련한 정보주체의 불만처리 및 피해구제 등을 위하여 아래와 같이 개인정보 보호책임자를 지정하고 있습니다.\\n- 개인정보 보호책임자: EM베스트 마케팅팀\\n- 연락처: qkrwodud30@naver.com"},{"subtitle":"7. 개인정보 열람청구","text":"정보주체는 개인정보 보호법 제35조에 따른 개인정보의 열람 청구를 아래의 부서에 할 수 있습니다. 회사는 정보주체의 개인정보 열람청구가 신속하게 처리되도록 노력하겠습니다.\\n- 개인정보 열람청구 접수․처리 부서: EM베스트 마케팅팀\\n- 연락처: qkrwodud30@naver.com"},{"subtitle":"8. 권익침해 구제방법","text":"정보주체는 아래의 기관에 대해 개인정보 침해에 대한 피해구제, 상담 등을 문의하실 수 있습니다.\\n- 개인정보 침해신고센터 (한국인터넷진흥원 운영): 118\\n- 개인정보 분쟁조정위원회: 1833-6972\\n- 대검찰청 사이버수사과: 02-3480-3573\\n- 경찰청 사이버안전국: 182"}]},"emailCollection":{"title":"이메일 무단수집 거부","content":[{"subtitle":"","text":"본 웹사이트에 게시된 이메일 주소가 전자우편 수집 프로그램이나 그 밖의 기술적 장치를 이용하여 무단으로 수집되는 것을 거부하며, 이를 위반시 정보통신망법에 의해 형사처벌됨을 유념하시기 바랍니다."},{"subtitle":"정보통신망 이용촉진 및 정보보호 등에 관한 법률","text":"제50조의2 (전자우편주소의 무단 수집행위 등 금지)\\n① 누구든지 전자우편주소의 수집을 거부하는 의사가 명시된 인터넷 홈페이지에서 자동으로 전자우편주소를 수집하는 프로그램이나 그 밖의 기술적 장치를 이용하여 전자우편주소를 수집하여서는 아니 된다.\\n② 누구든지 제1항을 위반하여 수집된 전자우편주소를 판매·유통하여서는 아니 된다.\\n③ 누구든지 제1항과 제2항에 따라 수집·판매 및 유통이 금지된 전자우편주소임을 알면서 이를 정보 전송에 이용하여서는 아니 된다."}]}}');

